import React from 'react';

import { Proficient } from '../SkillData'
const Skill = () => {
  return (
    <div id="Skill">
    <section className='my-28  px-5'>
      <header className='text-2xl font-bold pt-10 mb-5 pb-3'>
        <h2>Skills & Tools</h2>
        <hr className='my-5 opacity-70'/>
      </header>
      {Proficient?.length > 0 &&
        <div className=''>
          {/* <h2 className='text-xl'> Proficient </h2> */}
          <div className='my-7 grid gap-6 grid-cols-3 md:grid-cols-6 content-center'>
            {Proficient.map((x, index) =>
              <div className='flex flex-col items-center' tabIndex='0' role='img' aria-label={x.skill} key={index}>
                <img src={x.logo} alt='' loading='lazy' className='w-16 mb-2' width='64px' height='64px' />
                {x.skill}
              </div>
            )}
          </div>
        </div>
      }
      <hr className='mtopacity-70'/>
      </section>
    </div>
  );
};

export default Skill;
